import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

import React, { Component } from 'react'
import News from './Components/News';
import NavBar from './Components/NavBar';


export default class App extends Component {



  render() {
    return (
      <Router>
        <NavBar/>
          <Routes>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/users">
              <Users />
            </Route>
            <Route path="/">
              <Home />
            </Route>
        </Routes>
      <div>

        <News />
      </div>
      </Router>
    )
  }
}
